    host: config.db.host,
    port: config.db.port,
    dialect: config.db.connection,
    logging: false,
    underscored: true,

    pool: {
        max: 20,
        min: 1,
        idle: 20000,
        acquire: 1000000
    },
    timestamps: false,
});

