import express from 'express';
import authController from './auth.controller';
import { localStrategy, jwtStrategy } from '../../../middleware/strategy';
import { sanitize } from '../../../middleware/sanitizer';
import { validateBody, schemas } from '../../../middleware/validator';

export const authRouter = express.Router();
authRouter.route('/register').post(sanitize(), validateBody(schemas.registerSchema), authController.register);
authRouter.route('/login').post(sanitize(), validateBody(schemas.loginSchema), localStrategy, authController.login);
authRouter.route('/changePassword').post(sanitize(), validateBody(schemas.changePassword), authController.changePassword);
authRouter.route('/sendReset').post(sanitize(), validateBody(schemas.sendResetPassword), authController.sendReset);
authRouter.route('/reset').post(sanitize(), validateBody(schemas.resetPassword), authController.resetPassword);
//authRouter.route('/add').post(sanitize(), validateBody(schemas.addUserSchema), jwtStrategy, authController.add);
authRouter.route('/otpGen').post(sanitize(), validateBody(schemas.otpSchema),authController.otpGen);
authRouter.route('/otpVerify').post(sanitize(), validateBody(schemas.loginSchema),authController.otpVerify);
authRouter.route('/userCheck').post(sanitize(), validateBody(schemas.userCheckSchema),authController.userCheck);

