import JWT from 'jsonwebtoken';
import { db } from '../../../models';
import mailer from '../../../mailer';
import config from '../../../config';
import bcrypt from 'bcrypt-nodejs';

var JWTSign = function (user, date) {
    return JWT.sign({
        iss: config.app.name,
        sub: user.id,
        iat: date.getTime(),
        exp: new Date().setMinutes(date.getMinutes() + 30)
    }, config.app.secret);
}
var makeid = () => {
    var text = "";
    var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";
    for (var i = 0; i < 7; i++)
      text += possible.charAt(Math.floor(Math.random() * possible.length));
    return text;
}
export default {
    async register(req, res) {
        const { firstName, lastName, email } = req.body;
        var password = bcrypt.hashSync(req.body.password);
        db.User.findOrCreate({where: {email: email}, defaults: {firstName, lastName, password}})
        .then(created => {
                    if(created[1]){
                        mailer.sendRegisterationLink(email);
                        return res.status(200).json({  success:'Verification Email send Your Email!',email: email });
                    }else{
                        return res.status(500).json({ errors: ['Email is Already Exits']});
                    }
        })
        .catch(err => {
            if(err && err.name && err.name == 'PRAException'){
                return res.status(500).json({'errors': [ err.msg ]});
            }else{
                console.log(err);
                return res.status(500).json({'errors': ['Error!!!']});
            }
        });
    },
    async login(req, res) {
        var date = new Date();
        var token = JWTSign(req.user, date);
        res.cookie('XSRF-token', token, {
            expire: new Date().setMinutes(date.getMinutes() + 30),
            httpOnly: true, secure: config.app.secure
        });
        return res.status(200).json({ success: true });
    },
    async changePassword(req, res,next) {
        var email = req.body.email;
        var newPass2=req.body.confirmPass;
        var newPass=req.body.newPass;
        var paswd=  /^(?=.*[0-9])(?=.*[!@#$%^&*])[a-zA-Z0-9!@#$%^&*]{7,15}$/;
        if(newPass.match(paswd)){
            if(newPass == newPass2){
                db.User.findOne({
                    where: { email: req.body.email, isNewUser: 1}
                }).then(user=>{
                   var isMatch= user.comparePassword(req.body.oldPass);
                   if(isMatch){
                       return user;
                   }
                   else {
                    throw new RequestError('Incorrect OTP/Old password');
                   }
                })
                .then(result => {
                    if(result){
                        var hash = bcrypt.hashSync(req.body.newPass);
                        db.User.update({ password: hash, verf_key: null, attempt: 0, valid: 1, isNewUser: 0 }, { where: { email: email } });
                        return res.status(200).json({ success: true });
                    }
                    else{
                        return res.status(500).json({ errors: ['Wrong Old password'] });
                    }
                }).catch(err => {
                    console.log(err);
                    next(err);
                })
            }
            else{
                return res.status(500).json({ errors: ['Password doesnt match'] });
            }
        } 
        else{
            return res.status(500).json({ errors: ['Password has to be between 8 to 20 characters which contain at least one numeric digit, one uppercase and one lowercase letter'] });
        }

    },
    async resetPassword(req, res) {
        const { email, verificationCode, password } = req.body;
        db.User.findOne({
            where: { email: email, verf_key: verificationCode }
        })
            .then(result => {
                if (result) {
                    var hash = bcrypt.hashSync(password);
                    db.User.update({ password: hash, verf_key: null, attempt: 0 ,isVerify: 1}, { where: { email: email } });
                    return res.status(200).json({ success: true });
                } else {
                    return res.status(500).json({ errors: ['Invalid verification code!'] });
                }
            })
            .catch(err => {
                console.log(err);
                return res.status(500).json({ errors: ['Error Updating Password!'] });
            })

    },
    async otpGen(req, res, next) {
        var isNewUser = 1;
        var moduleEntries = [];
        var parentId = null;
        const { firstName, lastName, email, phone } = req.body;
        const newPassword = Math.random().toString(36).replace('0.', '');
        var password = bcrypt.hashSync(newPassword);
        db.User.findOrCreate({ where: { email: email }, defaults: { firstName, lastName, password, phone, parentId, isNewUser } })
            .then(created => {
                if (created[1]) {
                    db.Module.findAll({ where: { access: 'Default' } })
                        .then(modules => {
                            if (created[1]) {
                                for (var i = 0; i < modules.length; i++) {
                                    moduleEntries.push({ userId: created[0].id, moduleId: modules[i].id, accessType: 'read,write,delete' });
                                }
                                return db.UserModule.bulkCreate(moduleEntries);
                            } else return res.status(500).json({ errors: ['Error finding privileges!'] });
                        })
                        .then(result => {
                            if (result) {
                                mailer.sendNewUserLink(email, newPassword);
                                return res.status(200).json({ status: "200", email: email, msg: "OTP GENERATED" });
                            } else {
                                return res.status(500).json({ errors: ['Error creating user privileges!'] });
                            }
                        });
                } else {
                    return res.status(200).json({ firstName: created[0].firstName, lastName: created[0].lastName, email: created[0].email, errors: ['Email is already in use'] });
                }
            })
            .catch(err => {
                if (err && err.name && err.name == 'PRAException') {
                    return res.status(500).json({ 'errors': [err.msg] });
                } else {
                    console.log(err);
                    return res.status(500).json({ 'errors': ['Error!!!'] });
                }
            });
    },
    async otpVerify(req, res, next) {
        const email = req.body.email;
        var User;
        var password=req.body.password;
        db.User.findOne({where: { email: req.body.email, isNewUser: 1 }})
            .then((result) => {
