                res.cookie('XSRF-token', token, {
                    expire: new Date().setMinutes(date.getMinutes() + 30),
                    httpOnly: true, secure: config.app.secure
                });
                res.user=User.id;
                 return res.status(200).json({ success: true, otp: "OTP VERFIED" }); }
            else {
                return res.status(500).json({ errors: ['Invalid email'] });
            }
        })
        .catch(err => {
            console.log(err);
            return res.status(500).json({ errors: ['WRONG OTP!'] });
        })
    },
    async sendReset(req, res) {
        const { email } = req.body;
