import nodemailer from 'nodemailer';
import config from './config';
import { db } from './models';

export default {

    sendNewUserLink: (email,password) => {
    },
    sendRegisterationLink: (email) => {
        return new Promise((resolve, reject) => {
            try{
                db.User.findOne({where: {email: email}})

                .then((user) => {
                    if(user){
                        if(user.valid == 0){
                            var key = Math.random().toString(36).slice(2);
                            db.User.update({verf_key: key}, {where: {id: user.id}})
                            .then(r => {
                                var smtpTransport = nodemailer.createTransport({
                                    host: config.mail.host,
                                    port: config.mail.port,
                                    auth: {
                                        user: config.mail.username,
                                        pass: config.mail.password
                                    },
                                    tls: {rejectUnauthorized: false},
                                });
                                smtpTransport.sendMail({
                                    from: config.mail.from,
                                    to: email,
                                    subject: 'KDMARC Email Verification',
                                    html: "Click on this link to verify your Email - "+ config.app.url+"/verify/"+email+"/"+key,
                                }, function(error, info){
                                    if(error){
                                        return reject({
                                            name: "PRAException",
                                            msg: 'Email Sending Failed'
                                        })
                                    }
                                    return resolve(true)
                                });
                            })
                        }
                    }else throw {
                        name: "PRAException",
                        msg: 'Email Body not available'
                    }
                })
            }catch(err){
                reject(err);
            }
        });
    },
    sendResetPassword: (email) => {
        return new Promise((resolve, reject) => {
            try{
                db.User.findOne({where: {email: email}})
                .then(user => {
                    if(user.valid == 1){
                        var key = Math.random().toString(36).slice(2);
                        db.User.update({verf_key: key}, {where: {id: user.id}})
                        .then(r => {
                            var smtpTransport = nodemailer.createTransport({
                                host: config.mail.host,
                                port: config.mail.port,
                                auth: {
                                    user: config.mail.username,
                                    pass: config.mail.password
                                },
                                tls: {rejectUnauthorized: false},
                            });
                            smtpTransport.sendMail({
                                from: config.mail.from,
                                to: email,
                                subject: 'KDMARC Password Reset',
                                text: "Click on this link to reset your password - "+config.app.url+"/reset/"+email+"/"+key,
                            }, function(error, info){
                                if(error){
                                    return reject({
                                        name: "PRAException",
                                        msg: 'Email Sending Failed',
                                        error: error
                                    })
                                }
                                return resolve(true)
                            });
                        })
                    }else{
                        reject(new Error('user not valid'));
                    }
                })
            }catch(err){
                reject(err);
            }
        });
    },
}

