import { db } from '../../../models';
import { throws } from 'assert';
export default {

    /*List Of Lead Api Strat here.............................................. */
    /* author:Ashish ...........................................*/

    async index(req, res, next) {

        let limit = 10;
        let sort = ['createdAt', 'DESC'];
        let offset = 0;
        let search = '%%';
        let page = 1;
        if (req.query.limit != undefined) {
            limit = parseInt(req.query.limit);
        }
        if (req.query.search != undefined) {
            search = '%' + req.query.search + '%';
        }
        if (req.query.page != undefined) {
            page = req.query.page;
            if (page < 1)
                page = 1;
        }
        if (req.query.sort) {
            if (req.query.sort == 'name') {
                sort = ['name'];
            }
        }

        db.Lead.findAndCountAll({
            order: [
                ['id', 'DESC'],
            ],
        })
            .then(Lead => {
                let pages = Math.ceil(Lead.count / limit);
                offset = limit * (page - 1);
                return db.Lead.findAll({
                    limit: limit,
                    offset: offset,
                    order: [sort],
                }).then(r => [r, Lead.count, pages])

                    .then(([Lead, count, pages]) => {
                        res.status(200).json({ success: true, Lead: Lead, count: count, pages: pages });
                    })
                    .catch(err => {
                        next(err)
                    })

            })
    },

}
