import express from 'express';
import clientController from './client.controller';
import multer from 'multer';
import path from 'path';
import { jwtStrategy } from '../../../middleware/strategy'
import { sanitize } from '../../../middleware/sanitizer';
import { validateBody, schemas } from '../../../middleware/validator';


var attachmentDir = path.join(path.dirname(require.main.filename), 'public', 'client', 'logo')

var storage = multer.diskStorage({
    destination: function (req, file, cb) {
      cb(null, attachmentDir)
    },
    filename: function (req, file, cb) {
      cb(null, Date.now() + path.extname(file.originalname))
    }
  })
var uploadAttachment = multer({ storage: storage, limits:{ fileSize: 10485760 }})

export const clientRouter = express.Router();
clientRouter.route('/add').post(jwtStrategy,sanitize(),uploadAttachment.single('logo'), clientController.addClient);
 clientRouter.route('/delete/:client_id').delete(jwtStrategy,clientController.delete);
 clientRouter.route('/clientlist').get(jwtStrategy,clientController.clientList);
 clientRouter.route('/employeelist/:id').get(jwtStrategy,clientController.employeeList);
 clientRouter.route('/showClient/:key').get(jwtStrategy,clientController.showClient);
 clientRouter.route('/clientUpdate').patch(jwtStrategy,uploadAttachment.single('logo'),clientController.clientUpdate);

