import { db } from '../../../models';
import bcrypt from 'bcrypt-nodejs';
var makeid = function () {
    var text = "";
    var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz";
    for (var i = 0; i < 7; i++)
        text += possible.charAt(Math.floor(Math.random() * possible.length));
    return text;
}
var makekey = function () {
    var text = "";
    var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";
    for (var i = 0; i < 20; i++)
        text += possible.charAt(Math.floor(Math.random() * possible.length));
    return text;
}
var generateKey = (size) => { 
    var text = ""; 
    var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789"; 
    for (var i = 0; i < size; i++) 
        text += possible.charAt(Math.floor(Math.random() * possible.length)); 
    return text; 
} 

export default {

    /* Add client api start here................................*/
    /* author:Ashish ...........................................*/

    async addClient(req, res, next) {
        var alias = makeid();
        var key = makekey();
        var password ="qwerty";
        db.Company.findOne({ where: { alias: alias } })
            .then(find => {
                if (find) {
                    res.status(200).json({ status: false, 'Error': " Alias  is Already Exits" });
                }
                else {
                    return db.Company.create({
                        alias: alias,
                        logo: req.file ? req.file.filename : null,
                        key: key,
                    })
                }

            })
            .then(client => {
                if (client) {
                    return db.User.create({
                        firstName: req.body.firstName,
                        lastName: req.body.lastName,
                        phone: req.body.phone,
                        email: req.body.email,
                        password: bcrypt.hashSync(password),
                        companyId:client.id,
                        isNewUser: 1
                    })
                }
                else {
                    res.status(500).json({ 'success': false });
                }
            })
            .then(success => {
                if (success)
                    res.status(200).json({ 'success': "Client Is Sucessfully Created !" });
                else
                    throw new RequestError("Somthing is worng  !", 500);
            })
            .catch(err => {
                next(err);
            });

    },

    /*delete Client Api Strat here.............................................. */
    /* author:Ashish ...........................................*/

    async delete(req, res, next) {
        return db.client.destroy({ where: { id: req.params.client_id } })
            .then(result => {
                if (result) {
                    res.status(200).json({ message: "Deleted successfully" });
                } else {
                    throw new RequestError("Some Params Missing  !", 500);
                }
            })
            .catch(err => {
                next(err);
            });
    },

    /*List Of Client Api Strat here.............................................. */
    /* author:Ashish ...........................................*/
    async clientList(req, res, next) {
        return db.User.findAll({
            attributes: ['id', 'firstName', 'lastName', 'email', 'phone'],
            include: [{ model: db.Company, attributes: ['id', 'logo', 'alias','key'], required: false, }]
        })
            .then(re => {
                // console.log(re);
                if (re)
                    return res.status(200).json({ clientList: re });
                else
                    throw new RequestError("Client List Not founds  !", 500);
            })
            .catch(err => {
                next(err);
            });
    },

    /* update client api start here................................................*/
    /* author:Ashish ...........................................*/

    async clientUpdate(req, res, next) {
        return db.User.findOne({ where: { companyId: req.body.companyId } })
            .then(Users => {
                if (Users) {
                    return db.User.update({
                        firstName: req.body.firstName,
                        lastName: req.body.lastName,
                        phone: req.body.phone,
                        email: req.body.email,
                    }, {
                            where: { companyId: req.body.companyId },
                        }).then(updateUser => [updateUser, Users])
                }
            })
            .then(([re, Users]) => {
                if (req.body.logo != 'null') {
                    return db.Company.update({ logo: req.file ? req.file.filename : null, }, { where: { id: Users.companyId }, }).then(userUpdate => [Users])
                }
                else {
                    return [Users];
                }
            })
            .then(([Users]) => {
                return db.UserPackage.findAll({ where: { companyId: Users.companyId } }).then(findpack => [findpack, Users])
            })
            .then(([list, Users]) => {
                var array = req.body.value.split(",");
                var values = [];
                for (var i = 0; i < list.length; i++) {
                    values.push({
                        value: array[i],
                        userId: list[i].userId,
                        companyId: Users.companyId,
                        name: list[i].name,

                    })
                    db.UserPackage.destroy({ where: { id: list[i].id } })
                }
                return db.UserPackage.bulkCreate(values);
            })
            .then(list1 => {
                if (list1)
                    res.status(200).json({ status: true, message: "Upadte successfully" });
                else
                    throw new RequestError("something is going worng !", 500);
            })
            .catch(err => {
                next(err);
            });


    },
    /* show client api start here................................................*/

    async showClient(req, res, next) {
        return db.User.findOne({ where: { companyId:req.params.key } })
            .then(re => {

                if (re) {
                    return db.Company.findOne({ where: { id: re.companyId } }).then(Company => [Company, re])
                } else {
                    throw new RequestError("Something is going Worng !", 500);
                }
            }).then(([Company, user]) => {
                if (Company)
                    return db.UserPackage.findAll({ where: { companyId: Company.id } }).then(UserPackage => [UserPackage, Company, user])
                else
                    throw new RequestError("Something is going Worng !", 500);
            })
            .then(([UserPackage, Company, user]) => {
                if (user)
                    return res.status(200).json({ Company: Company, User: user, UserPackage: UserPackage });
                else
                    throw new RequestError("Something is going Worng !", 500);
            })
            .catch(err => {
                next(err);
            });

    },

    async employeeList(req, res, next) {
        return db.User.findOne({ where: { companyId: req.params.id } })
            .then(users => {
                if (users) {
                    return db.Employee.findAll({ where: { companyId: users.companyId } })
                }
                throw new RequestError("something is going worng !", 500);
            })
            .then(Employee => {
                if (Employee) {
                    res.status(200).json({ "Employee": Employee });
                } else {
                    throw new RequestError("something is going worng !", 500);
                }
            }).catch(err => {
                next(err);
            });
    },

    // add domains, key , isvarify , id

}

