import { db } from '../../../models';
import { DNS } from '../../../kdmarc/dns';
import dmarc from "dmarc-solution";
import config from '../../../config';
import { Cloudns } from '../../../kdmarc/cloudns';
var cloudns = new Cloudns(config.cloudns.authId, config.cloudns.authPass);
let dns = new DNS();

var generateKey = (size) => {
    var text = "";
    var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";
    for (var i = 0; i < size; i++)
        text += possible.charAt(Math.floor(Math.random() * possible.length));
    return text;
}
var generate =(domainName,next)=>{
		var  v='DMARC1',p='quarantine', pct=20, adkim='s', aspf='r',rua=[config.cloudns.rua];
		return dmarc.generate({ v: 'DMARC1', p,rua,ruf, pct, adkim, aspf}).then(dmarcr => [dmarcr, domainName])
			.then(([dmarcRecord, domainName]) => {
                if(dmarcRecord)
				return cloudns.addRecord('dmarc.kdmarc.com', 'TXT', dmarcRecord, domainName).then(r => [r, domainName]);
            })	
            .catch(err => {
                console.log(err);
                next(err)

            })		
}
export default {
    // add domains, key , isvarify , id
    async addDomains(req, res, next) {
        var companyId = req.query.id;
        var domainName = req.query.domainName;
        db.Domain.findOne({ where: { name: domainName } })
            .then(domain => {
                if (domain) {
                    return db.UserDomain.findOne({ where: { companyId: companyId } })
                }
                return null;
            })
            .then(alreadydom => {
                if (alreadydom) {
                    throw new RequestError('Domain already added in Company');
                }
                return null;
            })
            .then(userDomain => {
                return cloudns.findRecord('dmarc.kdmarc.com', domainName, 'TXT')
            })
            .then(cloudnsRecord => {
                console.log(cloudnsRecord);
                if (!cloudnsRecord || (cloudnsRecord && typeof cloudnsRecord === 'object' && cloudnsRecord.length == 0)) {
                    return dns.getNSRecords(domainName);
                }
                throw new RequestError('Failed to generate DMARC Record. Kindly contact Administrator');
            })
            .then(NSrecord => {
                 generate(domainName,next);
                if (NSrecord) {
                    return db.Domain.create({ name: domainName })
                }
                throw new RequestError('Invalid Domain', 500);
            })

            .then(domain => {
                var domainKey = generateKey(7);
                return db.UserDomain.create({ companyId: companyId, domainId: domain.id, isVerify: 1, isConfigure: 1, key: domainKey })
            })
            .then(UserDomain => {
                return res.status(200).json({ 'success': true, 'domainId': UserDomain.domainId, "key": UserDomain.key, 'domainName': domainName });
            })
            .catch(err => {
                if (typeof err.message === 'string' && err.message.indexOf('queryNs ENOTFOUND') !== -1) {
                    return next(new RequestError('Domain Name is not registered!', 500))
                }
                next(err)

            })
    },
    async companyList(req, res, next) {
        db.Company.findAll()
            .then(domain => {
                res.status(200).json({ success: true, domain: domain });
            })
            .catch(err => {
                next(err)
            })
    },
    async domainList(req, res, next) {
        var comId = req.query.id;
        db.Domain.findAll({
            attributes: ['name'],
            include: [{ model: db.UserDomain, required: true, where: { companyId: comId }, attributes: ['id'], include: [{ model: db.Company, required: true, attributes: ['name', 'logo'], where: { id: comId } }] }]
        })
