import dns from 'dns'; 

export class DNS { 
    constructor() { 
        this.dns = dns; 
        this.dns.setServers(['1.1.1.1'], ['1.0.0.1'], ['8.8.8.8']); 
    } 

    getNSRecords(domainName) { 
        return new Promise((resolve, reject) => { 
            this.dns.resolveNs(domainName, function (error, data) { 
                if (error) { return reject(error); } 
                resolve(data); 
            }); 
        }); 
    } 

    getTXTRecords(domainName){ 
        return new Promise((resolve, reject) => { 
            this.dns.resolveTxt(domainName, (err, records) => { 
                if (err) reject(err); 
                resolve(records); 
            }) 
        }) 
    } 
}

