import { Request } from './request'; 
import json from '../../cloudns.json'; 
import config from '../config'; 
let request = new Request(json.base); 

export class Cloudns { 

    addRecord(domainName, recordType, record, host, ttl=3600) { 
        return request.get({ path: json.records.add }, { 
            'auth-id': config.cloudns.authId, 
            'auth-password': config.cloudns.authPass, 
            'domain-name': domainName, 
            'host': host, 
            'record-type': recordType, 
            'record': record, 
            'ttl': ttl 
        }) 
    } 

    findRecord(domainName, host, type){ 
        return request.get({ path: json.records.list }, { 
            'auth-id': config.cloudns.authId, 
            'auth-password': config.cloudns.authPass, 
            'domain-name': domainName, 
            'host': host, 
            'type':type 
        }) 
    } 

    updateRecord(domainName,recordID, record, host, ttl=3600) { 
        console.log(recordID); 
        return request.get({ path: json.records.update }, { 
            'auth-id': config.cloudns.authId, 
            'auth-password': config.cloudns.authPass, 
            'domain-name': domainName, 
            'host': host, 
            'record-id': recordID, 
            'record': record, 
            'ttl': ttl 
        }) 
    } 




}

