import request from 'request'; 
import { generateQueryString } from '../functions'; 

export class Request { 

    constructor(baseUrl) { 
        this.baseUrl = baseUrl; 
    } 

    get(options, data) { 
        let url = undefined; 
        if (options) { 
            if (options.url) url = options.url; 
            if (!options.url && options.baseUrl) this.baseUrl = options.baseUrl; 
            if (!options.url && options.path) { 
                if (!this.baseUrl) throw new Error('Base URL not set.'); 
                url = this.baseUrl + options.path; 
            } 
        } else throw new Error('URL Not available'); 
        return new Promise((resolve, reject) => { 
            request.get(url + '?' + generateQueryString(data), (error, response, body) => { 
                if (error) { return reject(error); } 
                resolve(JSON.parse(body)); 
            }); 
        }); 
    } 

}

