import { db } from "../../../../models";

export default {
    async register(req, res) {
         res.render('register');
    },
    async login(req, res) {
        res.render('login', {layout: 'auth'});
    },
    // async change(req, res) {

    //         db.User.findOne({where: {email: req.params.email,isNewUser:1}})
    //         .then(user=>{
    //             if(user){
    //                 res.render('change-password');
    //             }else{
    //                 throw {
    //                     name: 'PRAException',
    //                     msg: 'Invalid Request!'
    //                 }}
    //         }).catch(err=>{
    //             return  res.redirect('/login');
    //         })

    // },
    async logout(req, res) {
        if(req.user){
            req.user.update({loggedOutAt: new Date()});
        }
        res.clearCookie("XSRF-token");
        return res.redirect('/login');
    },
    async verifyMessage(req, res) {
        res.render('verify', {layout: 'auth'});
    },
    async sendReset(req, res) {
        res.render('sendReset', {layout: 'auth'});
    },
    async verify(req, res) {
        db.User.findOne({where: {email: req.params.email, verf_key: req.params.token}})
        .then(user => {
            if(user){
                return db.User.update({valid: 1}, {where: {id: user.id}})
            }else{
                throw {
                    name: 'PRAException',
                    msg: 'Invalid Request!'
                }
            }
        })
        .then(r => {
            return res.render('verifySuccess', {layout: 'auth', message: "Email Verified Successfully"});
        })
        .catch(err => {
            if(err && err.name && err.name == 'PRAException'){
                return res.render('verifySuccess', {layout: 'auth', message: "Invalid token received"});
            }else{
                console.log(err);
                return res.render('verifySuccess', {layout: 'auth', message: "Invalid token received"});
            }
        })
    },
    async reset(req, res) {
        db.User.findOne({where: {email: req.params.email, verf_key: req.params.token}})
        .then(user => {
            if(user){
                return res.render('reset', {email: req.params.email, verf_key: req.params.token, layout: 'auth'});
            }else{
                throw {
                    name: 'PRAException',
                    msg: 'Invalid Request!'
                }
            }
        })
        .catch(err => {
            if(err && err.name && err.name == 'PRAException'){
                return res.status(500).send(err.msg);
            }else{
                console.log(err);
                return res.status(500).send('Error!');
            }
        })
    },
};

