import { db } from '../../../models';
export default {

    /* Api   : Add domain In record...................................................
       url   : /api/record/add........................................................
    */
    async record(req, res) {
        const { name, master, last_check, type, notified_serial, account_id, content, prio, ttl, domain_id } = req.body;
        var msg;
        db.domain.findOne({ where: { id: domain_id } })
            .then(domain => {
                if (domain) {
                    var now = new Date().getTime();
                    if (type === 'SOA') {
                        if (req.body.name == '' || req.body.name == null) {
                            msg="SOA Record Inserted";
                           return  db.record.create({ domain_id: domain_id, name: name + '.' + domain.name, content: content, type, ttl: ttl, prio: prio, change_date: now })
                        } else {
                            res.status(500).json({ Error: "Invalid value for name field of SOA record. It should be the name of the zone." })
                        }
                    } else if (type === 'AAAA') {
                        if (req.body.content.match('(([0-9a-fA-F]{1,4}:){7,7}[0-9a-fA-F]{1,4}|([0-9a-fA-F]{1,4}:){1,7}:|([0-9a-fA-F]{1,4}:){1,6}:[0-9a-fA-F]{1,4}|([0-9a-fA-F]{1,4}:){1,5}(:[0-9a-fA-F]{1,4}){1,2}|([0-9a-fA-F]{1,4}:){1,4}(:[0-9a-fA-F]{1,4}){1,3}|([0-9a-fA-F]{1,4}:){1,3}(:[0-9a-fA-F]{1,4}){1,4}|([0-9a-fA-F]{1,4}:){1,2}(:[0-9a-fA-F]{1,4}){1,5}|[0-9a-fA-F]{1,4}:((:[0-9a-fA-F]{1,4}){1,6})|:((:[0-9a-fA-F]{1,4}){1,7}|:)|fe80:(:[0-9a-fA-F]{0,4}){0,4}%[0-9a-zA-Z]{1,}|::(ffff(:0{1,4}){0,1}:){0,1}((25[0-5]|(2[0-4]|1{0,1}[0-9]){0,1}[0-9])\.){3,3}(25[0-5]|(2[0-4]|1{0,1}[0-9]){0,1}[0-9])|([0-9a-fA-F]{1,4}:){1,4}:((25[0-5]|(2[0-4]|1{0,1}[0-9]){0,1}[0-9])\.){3,3}(25[0-5]|(2[0-4]|1{0,1}[0-9]){0,1}[0-9]))')) {
                            msg="AAAA Record Inserted";
                            return  db.record.create({ domain_id: domain_id, name: name + '.' + domain.name, content: content, type, ttl: ttl, prio: prio, change_date: now })
                        }
                        else {
                            res.status(200).json({ Error: "IPV6 Required" });
                        }
                    }
                    else if (type === 'A') {
                        if (req.body.content.match('^(([0-9]|[1-9][0-9]|1[0-9]{2}|2[0-4][0-9]|25[0-5])\.){3}([0-9]|[1-9][0-9]|1[0-9]{2}|2[0-4][0-9]|25[0-5])$')) {
                            msg="A Record Inserted";
                            return  db.record.create({ domain_id: domain_id, name: name + '.' + domain.name, content: content, type, ttl: ttl, prio: prio, change_date: now })
                        }
                        else {
                            res.status(200).json({ Error: "IPV4 Required" });
                        }
                    }
                    else if (type === 'TXT') {
                        msg="TXT Record Inserted";
                        return  db.record.create({ domain_id: domain_id, name: name + '.' + domain.name, content: content, type, ttl: ttl, prio: prio, change_date: now })

                    }
                    else if (type === 'MX') {
                        msg="MX Record Inserted";
                        return  db.record.create({ domain_id: domain_id, name: name + '.' + domain.name, content: prio + ' ' + content, type, ttl: ttl, prio: prio, change_date: now })
                    }
                    else if (type === 'CNAME') {
                        if (name != '') {
                            msg="CNAME Record Inserted";
                            return  db.record.create({ domain_id: domain_id, name: name + '.' + domain.name, content: content, type, ttl: ttl, prio: prio, change_date: now })

                        } else {
                            res.status(200).json({ status: "CNAME is required" });
                        }

                    } else if (type === 'PTR') {
                        msg= "PTR Record Inserted";
                        return  db.record.create({ domain_id: domain_id, name: name + '.' + domain.name, content: content, type, ttl: ttl, prio: prio, change_date: now })

                    }
                    else if (type === 'NAPTR') {
                        msg="NAPTR Record Inserted";
                        return  db.record.create({ domain_id: domain_id, name: name + '.' + domain.name, content: content, type, ttl: ttl, prio: prio, change_date: now })

                    }
                    else if (type === 'NS') {
                        msg="NS Record Inserted";
                        return  db.record.create({ domain_id: domain_id, name: name + '.' + domain.name, content: content, type, ttl: ttl, prio: prio, change_date: now })
                    }

                } else {
                    res.status(500).json({ status: "Record is not found" });
                }
            })
            .then(result=>{
                res.status(200).json({ status: msg });
            })

    },

    /* Api   : Delete Record....................................................
       params : record_id.......................................................
       url    :/api/record/delete/1.............................................
       request : delete.........................................................
      */
    async delete(req, res) {
        db.record.destroy({ where: { id: req.params.record_id } }).then(result=>{
            res.status(200).json({ message: "Deleted successfully" });
        })
    }
    ,

    /* Api   : Get Record as Edit zone Base on Domain...........................
       params : domain_id.......................................................
       Url    :/api/record/getrecord/1..........................................
       request : get............................................................
      */

    async get_record_by_doaminID(req,res){
        db.record.findAll({ where: { domain_id:req.params.domain_id } })
        .then(re=>{
            res.status(200).json({ status: "true",data:re}); 
        })

    },

      /* Api   : Upadte Record as update zone Base on Domain...................
         params : name:name,type:type,content:content,prio:prio,ttl:ttl........
         request : patch.......................................................

      */
    async update_record_by_doaminID(req,res){
        const { name, type,content, prio, ttl } = req.body;
        if(req.body.domain_id && req.body.record_id ){
            db.record.update({name:name,type:type,content:content,prio:prio,ttl:ttl},{where:{ domain_id:req.body.domain_id,id:req.body.record_id}})
            .then(re=>{
                if(re==1)
                res.status(200).json({ status: "true",message:"Record Updated"});
                else
                res.status(200).json({ status: "true",message:"Something is wrong !"});
            })
        }else{
            res.status(500).json({ status: "false",Error:"Please Send Domain id And Record Id"});
        }


    }



}

