import { db } from '../../../models';
import bcrypt from 'bcrypt-nodejs';
export default {

    /*Add User Api Start here................................................*/
    async addUser(req,res){
        var { name,password, email, phone } = req.body;
        var password = bcrypt.hashSync(password);
        db.User.findOrCreate({where: {email: email}, defaults: {firstName:name, password,phone,valid:1}})
        .then(created => {
            console.log(JSON.stringify(created))
            if(created[1]){
                return res.status(200).json({ success:"User has been created"});
            }else{
                return res.status(500).json({ errors: ['Email is already in use']});
            }
        })
    },

  /*List Of User Api Strat here.............................................. */ 
    async userList(req,res){
        return db.User.findAll({})
        .then(re=>{
            if(re)
            return res.status(200).json({users:re});
            else
            return res.status(500).json({ errors: ['User List Not founds']});

        })

    },
    /*delete User Api.........................................................*/
    async delete(req, res) {
        db.User.destroy({ where: { id:req.params.id } }).then(result=>{
            if(result)
            res.status(200).json({ message: "Deleted successfully" });
            else
            res.status(500).json({ message: "Something is going Worng !" });
        })
    },
    async showUser(req, res) {
        db.User.findOne({ where: { id:req.params.id } }).then(result=>{
            if(result)
            res.status(200).json({ user:result});
            else
            res.status(500).json({ message: "User Not found  !" });
        })
    },

    /* User update Api.......................................................*/
    async updateUser(req,res){
        var { name, email, phone } = req.body;
        if(req.body.user_id){
            db.User.update({firstName:name,email,phone},{where:{id:req.body.user_id}})
            .then(re=>{
                if(re==1)
                res.status(200).json({ status: "true",message:"User has been updated!"});
                else
                res.status(200).json({ status: "false",message:"User not found"});
            })
        }else{
            res.status(500).json({ status: "false",Error:"Please Send UserId !"});
        }


    }


}
